import logo from './logo.svg';
import './App.css';

function App() {
  const persona = {
    nombre: 'Tony',
    edad: 45,
    clave: 'roman',
  };

  const usContext = ({nombre,edad,clave})=>{

    return {
      nombreClave: clave,
      anios: edad,
      latlng: {
        lat:14.645645,
        lng:234.2334
      }
    }
  }

  const avenger = usContext( persona );
  console.log(avenger);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
